import React from 'react'
import ListingCard from './ListingCard'

function Listing({list, OnDeleteHouse}) { 
  const houseComponent = list.map((house) => <ListingCard key={house.id} house={house} onDeleteHouse={onDeleteHouse}/>
  )
  return (
    <div>
      <h2>House Listing</h2>
      <div>
        {houseComponent}
      </div>
    </div>
  );
}

export default Listing
